import "../styles/profilephoto.css";

import logo from "../assets/logoOneGoal.png";
const ProfilePhoto = () => {
  return (
    <>
      <div className="photoContainer">
        <img src="logo" />
      </div>
    </>
  );
};
export default ProfilePhoto;
